import React from 'react';
import {
    Link
  } from "react-router-dom";



export default function NavBar () {

    return (
        <div className="topnav">
            <Link to="/#AboutMe">About Me</Link>
            <Link to="/#Experience">Experience</Link>
            <Link to="/#AboutMe">About Me</Link>
            <a href="#Contact">Contact me</a>
        </div>
  );
}
